import FinanceItem from "./components/FinanceItem";

function App() {
  const financeItems = [
    {
      id: "aaa",
      title: "Book",
      Date: new Date(2021, 29, 8).toISOString,
      Price: 250,
      Currency: "CZK",
    },
    {
      id: "bbb",
      title: "Drink",
      Date: new Date(2021, 22, 8).toISOString,
      Price: 120,
      Currency: "CZK",
    },
    {
      id: "ccc",
      title: "Mobile",
      Date: new Date(2021, 27, 7).toISOString,
      Price: 19999,
      Currency: "CZK",
    },
  ];

  let financeItemsJSX = financeItems.map((fi) => (
    <FinanceItem
      title={fi.title}
      date={fi.date}
      price={fi.price}
      currency={fi.currency}
    ></FinanceItem>
  ));

  return <div>{financeItemsJSX}</div>;
}

export default App;
